import {useState} from 'react';
import { planets } from '../data/planets.js'

function Home() {
  const [fromPlanet, setFromPlanet] = useState(null);
  const [toPlanet, setToPlanet] = useState(null);
  const [date, setDate] = useState(null);
  console.log({fromPlanet});
  console.log({toPlanet});
  return (
    <>
      <div className="container mx-auto">
        <div className="hero min-h-full lg:mt-5 align-center py-5">
          <div>
            <div className="flex flex-col text-center items-center">
              <h1 className="text-5xl font-bold">Where would you like to go?</h1>
            </div>
          </div>
        </div>
        {fromPlanet ? (<h6 className="text-lg ">Selected From Planet: <span className="font-bold">{fromPlanet}
        </span></h6>) : (<h6 className="text-lg  mt-4">Select From Planet: </h6>)}
        <div className="grid grid-cols-4 mx-auto gap-4 justify-center text-center mt-4">
          {
            planets.map((planet) => (
              <div id={planet.id}>
                <button onClick={() => setFromPlanet(planet.name)} className="focus:border-4 focus:border-primary rounded-xl mx-auto">
                  <figure><img className="rounded-xl object-contain " src={`/images/${planet.image}`} alt="Titan" width={150} /></figure>
                </button>
              </div>
            ))
          }
        </div>
        {toPlanet ? (<h6 className="text-lg ">Selected To Planet: <span className="font-bold">{toPlanet}
        </span></h6>) : (<h6 className="text-lg  mt-4">Select To Planet: </h6>)}
        <div className="grid grid-cols-4 mx-auto gap-4 justify-center text-center mt-4">
          {
            planets.map((planet) => (
              <div id={10+planet.id}>
                <button onClick={() => setToPlanet(planet.name)} className="focus:border-4 focus:border-primary rounded-xl mx-auto">
                  <figure><img className="rounded-xl object-contain " src={`/images/${planet.image}`} alt="Titan" width={150} /></figure>
                </button>
              </div>
            ))
          }
        </div>
        <div>
          <h6 className="text-lg italic mt-4">Select Date: </h6>

        </div>
      </div>
    </>
  );
}
export default Home;
